import logo from './logo.svg';
import './App.css';
import './index.css';
import ReactSearchBox from 'react-search-box'
import data from "./Components/ListData.json"

const List = (props) =>{
  function List(props) {
    return (
        <ul>
            {data.map((item) => (
                <li key={item.id}>{item.text}</li>
            ))}
        </ul>
    )
}
}


const SerachBox = (props) =>{
  return <ReactSearchBox
  placeholder="Search a course"
  value="Doe"
  // data={props.list}
  callback={(record) => console.log(record)}
  />
}



function App() {

  return (
    <div className="App">
      <button className = "loginButton">Login</button>

      <p className="helloWorld">
        Hello World
        <SerachBox/>
      </p>


    </div>


  );
}

export default App;
